import React from 'react';
import ''

let AuthItem = () => {
    return (
        <div id="form-wrapper">
            <form id="auth-form">
                <label>Enter email</label>
                <input type="text"/>
                <label>Enter password</label>
                <input type="password"/>
            </form>
        </div>
    )
}

export default AuthItem;
